import unittest


class Solution:
    def robotWithString2(self, s: str) -> str:
        t = []
        s = list(s)
        p = []
        while s:
            count = 0
            m = min(s)
            idx = s.index(m)
            for i in range(idx):
                t.append(s[0])
                s.pop(0)
                count += 1
            p.append(s.pop(0))
            if not s:
                break
            while t and t[-1] < min(s):
                p.append(t.pop())
            if t and t[-1] == min(s):
                if len(s) == 1:
                    p.append(t.pop())
            while t and t[-1] < min(s):
                p.append(t.pop())
            if t and t[-1] == min(s):
                idx = s.index(t[-1])
                t1, t2 = t[::-1], s[idx::-1]
                while t[::-1] < s[idx::-1]:
                    p.append(t.pop())

        return ''.join(p + t[::-1])

    # s is input
    # t is stack
    # p is output
    # use stack to store the characters, make sure p is lexicographically smallest
    def robotWithString(self, s: str) -> str:
        length = len(s)
        s = list(s)
        mlist = []  # tuple of (min, index)
        for i, c in enumerate(s[::-1]):
            if not mlist:
                mlist.append((c, len(s) - i - 1))
            else:
                if c <= mlist[-1][0]:
                    mlist.append((c, len(s) - i - 1))
                else:
                    mlist.append(mlist[-1])
        t, p = [], []
        while s:
            m, idx = mlist[len(s) - 1][0], mlist[len(s) - 1][1] - (length - len(s))
            if t and t[-1] <= m:
                p.append(t.pop())
                continue
            else:
                t += s[:idx + 1]
                s = s[idx + 1:]
        return ''.join(p + t[::-1])


class Test(unittest.TestCase):
    def test(self):
        cases = [
            ["zza", "azz"],
            ["bac", "abc"],
            ["bdda", "addb"],
            ["vzhofnpo", "fnohopzv"],
            ["mmuqezwmomeplrtskz", "eekstrlpmomwzqummz"],
            [
                "",
                ""],
            [
                "",
                ""]

        ]
        for ci, co in cases:
            result = Solution().robotWithString(ci)
            assert result == co, (ci, co, result)


